import React from "react";
import Logo from "../Logo";
import LongMenu from "../LongMenu";
import SearchIcon from "@material-ui/icons/Search";
import * as S from "./styles";

function Header() {
  return (
    <S.Header>
      <Logo />
      <LongMenu />
    </S.Header>
  );
}

export default Header;
